    // Rotate
    const rotated = translated.clone();
    rotated.x = rotated.x * c - rotated.y * s;
    rotated.y = rotated.x * s + rotated.y * c;

    // Translate back
    this.x = rotated.x + origin.x;
    this.y = rotated.y + origin.y;

    return this;
