  transformByQuat(q: any): Vec3 {
    if (q.array) q = q.array; // This just transforms the quaternion to an array.
    if (q instanceof Array && q.length >= 4) {
      const o = this.clone();
      const uv = new Vec3(
        q[1] * o.z - q[2] * o.y,
        q[2] * o.x - q[0] * o.z,
        q[0] * o.y - q[1] * o.x
